import React from "react";
import "../../styles/layout.css";

const Header = (props) => {
  return (
    <header>
      <div class="holder">
        <img src="img/logo-1.png" alt="logo Imagine_3D"></img>
        <h1>Imagine_3D</h1>
      </div>
    </header>
  );
};

export default Header;
